        \ in 1993. It is Petty&#39;s best-selling album to date and was certified\
        \ 12\xD7 Platinum by the RIAA on April 28, 2015. <br /><br />The single &quot;Mary\
        \ Jane&#39;s Last Dance&quot; became one of Petty&#39;s most popular songs,\
        \ reaching No. 14 on the Billboard Hot 100 and No. 1 on the Billboard Mainstream\
        \ Rock Tracks chart. <br /><br />The other new song on the album is a cover\
        \ of the Thunderclap Newman hit &quot;Something in the Air&quot;. The album\
        \ contains no songs from 1987&#39;s Let Me Up (I&#39;ve Had Enough). However,\
        \ three songs from Petty&#39;s 1989 solo album Full Moon Fever were included.<br\
        \ /><br />On its original release in November 1993, the album debuted at No.\
        \ 8 on Billboard 200, and first peaked at No. 5 on the chart in February 1994.\
        \ It reached a new peak of No. 2 following Petty&#39;s death in 2017.<br /><br\
        \ />The new tracks &quot;Mary Jane&#39;s Last Dance&quot; and &quot;Something\
